	(50, '102', 'Andi berjalan lurus menuju rumah Banu dengan jarak 10 km ke arah timur. Ia kemudian melanjutkan perjalanan ke selatan menuju rumah Cici yang berjarak 6 km. Selanjutnya, Andi menuju rumah Dani yang berjarak 4 km ke arah barat dan 2 km ke arah selatan. Berapakah jarak Andi dengan titik semula ', NULL, '9.000 m', NULL, NULL, '10.000 m', NULL, NULL, '11.000 m', NULL, NULL, '12.000 m', NULL, NULL, '13.000 m', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(51, '103', '<p class="MsoListParagraph" style="margin-left:0cm;mso-add-space:auto;text-align:\r\njustify"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:Calibri">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E.<o:p></o:p></span></p>Semua mahasiswa memiliki Nomor Induk mahasiswa. Anto seorang mahasiswa. Jadi,', NULL, 'Anto mungkin memiliki nomor induk mahasiswa.', NULL, NULL, 'Belum tentu Anto memiliki nomor induk mahasiswa', NULL, NULL, 'Anto memiliki nomor induk mahasiswa', NULL, NULL, 'Anto tidak memiliki nomor induk mahasiswa.', NULL, NULL, 'Tidak dapat ditarik kesimpulan', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(52, '103', '<p class="MsoListParagraph" style="margin-left:0cm;mso-add-space:auto;text-align:\r\njustify"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:Calibri">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E.<o:p></o:p></span></p>Semua pelajar wajib mengenakan sepatu. Sebagian pelajar menyukai baju kaos putih.', NULL, 'Semua pelajar mengenakan sepatu dan menyukai kaos putih.', NULL, NULL, 'Semua pelajar yang mengenakan sepatu pasti menyukai kaos putih.', NULL, NULL, 'Sebagian pelajar yang menyukai kaos putih, tidak mengenakan sepatu.', NULL, NULL, 'Semua pelajar yang menyukai kaos putih, bersepatu.', NULL, NULL, 'Semua pelajar yang menyukai kaos putih, tidak mengenakan sepatu.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(53, '103', '<p class="MsoListParagraph" style="margin-left:0cm;mso-add-space:auto;text-align:\r\njustify"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:Calibri">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E.<o:p></o:p></span></p>Semua siswa gemar bermain futsal. Siswa yang gemar bermain futsal, senang berenang. Siswa yang gemar berenang tidak pandai bermain anggar.', NULL, 'Siswa yang tidak pandai bermain anggar, tidak pandai bermain futsal.', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, gemar berenang dan tidak pandai bermain futsal.', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, pandai bermain futsal dan tidak gemar nerenang', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, tidak pandai bermain futsal dan tidak gemar berenang', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, pandai bermain futsal.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(54, '103', '<p class="MsoListParagraph" style="margin-left:0cm;mso-add-space:auto;text-align:\r\njustify"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:Calibri">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E.<o:p></o:p></span></p>Tidak ada seorangpun peserta ujian Mandiri di dalam ruang tes diperbolehkan membawa alat komunikasi. Sebagian mahasiswa masuk ke dalam ruangan ujian.', NULL, 'Sebagian mahasiswa di dalam ruang ujian tidak membawa alat komunikasi.', NULL, NULL, 'Sebagian peserta dalam ruang ujian diperbolehkan membawa alat komunikasi.', NULL, NULL, 'Semua peserta dalam ruangan ujian tidak diperbolehkan membawa alat komunikasi', NULL, NULL, 'Hanya peserta dalam ruang ujian yang dibolehkan membawa alat komunikasi.', NULL, NULL, 'Sebagian peserta dalam ruang ujian, bukan peserta ujian diperbolehkan membawa alat komunikasi.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(55, '103', '<p class="MsoListParagraph" style="margin-left:0cm;mso-add-space:auto;text-align:\r\njustify"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:Calibri">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E.<o:p></o:p></span></p>Jika saya tidak punya tugas kuliah maka saya belajar di perpustakaan.', NULL, 'Saya saat ini memiliki tugas kuliah dan pasti akan belajar di perpustakaan.', NULL, NULL, 'Saya sekarang ada di perpustakaan belajar, karena tidak punya tugas kuliah.', NULL, NULL, 'Sekarang saya tidak punya tugas kuliah, jadi saya tak perlu ke perpustakaan untuk belajar.', NULL, NULL, 'Saya tidak belajar di perpustakaan karena saya tidak punya tugas kuliah.', NULL, NULL, 'Sebagai mahasiswa yang baik, meskipun punya tugas kuliah, saya tetap akan belajar di perpustakaan.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(56, '103', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal"><span style="font-size: 12pt;">Atlet A, B, C\r\ndan D bertanding dalam suatu turnamen Tenis Meja. Setiap pemain saling bertemu\r\nsatu kali. Dalam setiap pertandingan, pemain yang menang, seri dan kalah,\r\nberturut-turut mendapatkan nilai 2, 1 dan 0. Data hasil pertandingan adalah A\r\nmenang dua kali, B seri dua kali, C kalah dua kali dan D tidak pernah seri.</span><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-ID;mso-fareast-language:EN-ID"><o:p></o:p></span></p>Urutan pemain yang memperoleh nilai tertinggi sampai ke terendah adalah', NULL, 'A, B, C dan D', NULL, NULL, 'B, A, C dan D', NULL, NULL, 'A, B, D dan C', NULL, NULL, 'B, A, D dan C', NULL, NULL, 'A, C, B dan D', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
