	(109, '202', 'Pada gambar di atas, jika (FG) sejajar dengan (HJ), maka berapakah sudut&nbsp;<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Cambria Math&quot;,serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-bidi-font-family:&quot;Cambria Math&quot;;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">âˆ </span><span lang="EN-US" style="font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">FJH ?</span>', '20249.png', '30', NULL, NULL, '38', NULL, NULL, '40', NULL, NULL, '56', NULL, NULL, '66', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(110, '202', 'Seekor semut berjalan pada tanah yang datar lurus 14 cm ke utara, 8 cm ke timur, 5 cm ke selatan dan 4  cm timur. Berapa cm kah jarak semut tersebut dari titik semula?', NULL, '8', NULL, NULL, '10', NULL, NULL, '14', NULL, NULL, '16', NULL, NULL, '18', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(111, '203', '<span style="font-size: 12pt; text-align: justify;">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E<br></span>Semua peserta ujian gemar bermain futsal.  Siswa yang gemar bermain futsal senang berenang. \r\nSiswa yang gemar berenang tidak pandai bermain anggar.', NULL, 'Siswa yang tidak pandai bermain anggar, tidak pandai bermain futsal dan tidak gemar berenang', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, tidak pandai bermain futsal.', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, gemar berenang dan tidak pandai bermain futsal.', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, pandai bermain futsal dan tidak gemar nerenang', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, pandai bermain futsal.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(112, '203', '<span style="font-size: 12pt; text-align: justify;">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E<br></span>Tidak ada seorangpun peserta ujian di diperbolehkan menyontek.\r\nSebagian mahasiswa masuk ke dalam ruangan tes.', NULL, 'Semua mahasiswa dalam ruangan tes tidak diperbolehkan menyontek.', NULL, NULL, 'Sebagian mahasiswa di dalam ruang tes tidak menyontek.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes diperbolehkan menyontek.', NULL, NULL, 'Hanya mahasiswa dalam ruang tes yang dibolehkan menyontek.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes bukan peserta ujian diperbolehkan menyontek.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(113, '203', '<span style="font-size: 12pt; text-align: justify;">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E<br></span>Setiap pembelian 4 celana gratis 1 kaos. Setiap pembelian 12 kaos gratis 1 celana. Luna membeli 10 celana dan 25 kaos.', NULL, 'Luna mendapat 12 celana dan 27 kaos. Luna mendapat 11 celana dan 27 kaos.', NULL, NULL, 'Luna mendapat 10 celana dan 26 kaos.', NULL, NULL, 'Luna mendapat 12 celana dan 25 kaos.', NULL, NULL, 'Luna mendapat 12 celana dan 27 kaos.', NULL, NULL, 'Luna mendapat 11 celana dan 26 kaos.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(114, '203', '<span style="font-size: 12pt; text-align: justify;">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E<br></span>Sebuah bus menempuh perjalanan dari Solo ke Yogjakarta selama 2,5 jam dengan kecepatan 70km/jam. Dika mengendarai sepeda motor mampu menempuh jarak yang sama namun hanya dalam waktu 2 jam.', NULL, 'Kecepatan sepeda motor Dika lebih cepat dibanding kecepatan bus.', NULL, NULL, 'Kecepatan bus sama dengan kecepatan sepeda motor Dika', NULL, NULL, 'Kecepatan sepeda motor Dika tidak jauh berbeda dengan kecepatan bus.', NULL, NULL, 'Antara bus dan Dika tidak bisa dibandingkan kecepatan tempuhnya.', NULL, NULL, 'Kecepatan sepeda motor Dika lebih kecil dibanding kecepatan bus.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
	(115, '203', '<p><span style="font-size: 12pt; text-align: justify;">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan-pernyataan pada pilihan A, B, C, D dan E</span></p><p>Tidak diizinkan membawa makanan dan minuman di dalam perpustakaan. Ada murid yang membawa makanan dan minuman. </p>', NULL, 'Beberapa murid minum jus di dalam perpustakaan.', NULL, NULL, 'Beberapa murid juga membawa makanan dan minuman.', NULL, NULL, 'Murid yang membawa makanan dan minuman tidak diperbolehkan masuk perpustakaan.', NULL, NULL, 'Beberapa murid tidak mematuhi peraturan perpustakaan.', NULL, NULL, 'Murid yang membawa makanan dan minuman tidak diperbolehkan masuk perpustakaan.', NULL, NULL, 'O', '2024-07-21 06:31:29', '2024-07-21 06:31:29'),
