	(171, '303', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Semua siswa memiliki Nomor Induk siswa. Ali seorang siswa. Jadi,..', NULL, 'Ali mungkin memiliki nomor induk siswa.', NULL, NULL, 'Belum tentu Ali memiliki nomor induk siswa.', NULL, NULL, 'Ali memiliki nomor induk siswa.', NULL, NULL, 'Ali tidak memiliki nomor induk siswa.', NULL, NULL, 'Tidak dapat ditarik kesimpulan.', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(172, '303', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Semua seniman kreatif, beberapa ilmuwan tidak kreatif', NULL, 'Beberapa ilmuwan tidak suka seniman', NULL, NULL, 'Tidak ada seniman yang ilmuwan', NULL, NULL, 'Beberapa individu kreatif bukan seniman', NULL, NULL, 'Beberapa ilmuwan kreatif', NULL, NULL, 'Semua ilmuwan kreatif', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(173, '303', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Nurul tidak kuliah maka ia membantu Ibunya berjualan.', NULL, 'Nurul saat ini kuliah dan ia pasti akan membantu Ibu berjualan di pasar.', NULL, NULL, 'Nurul sekarang ada di toko berjualan, karena tidak kuliah.', NULL, NULL, 'Sekarang Nurul tidak kuliah, jadi ia tak perlu ke pasar untuk membantu Ibunya berjualan.', NULL, NULL, 'Nurul tidak membantu Ibunya berjualan di pasar karena ia tidak kuliah.', NULL, NULL, 'Sebagai mahasiswa yang baik, meskipun punya kuliah, Nurul tetap akan membantu Ibunya berjualan di pasar.', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
