	(231, '403', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan\r\npernyataan berikut<br></span>Semua peserta ujian wajib membawa kartu ujian. Sebagian peserta ujian bersepatu.', NULL, 'Semua peserta ujian membawa kartu ujian dan mengenakan sepatu.', NULL, NULL, 'Semua peserta ujian yang membawa kartu ujian pasti bersepatu', NULL, NULL, 'Semua peserta ujian yang bersepatu membawa kartu ujian.', NULL, NULL, 'Sebagian peserta ujian yang bersepatu, tidak membawa kartu ujian.', NULL, NULL, 'Semua peserta ujian yang bersepatu, tidak membawa kartu ujian.', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(232, '403', '<span style="font-family: Calibri, sans-serif;">Bacalah pernyataan-pernyataan yang diberikan dengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan pernyataan berikut</span><br>Semua kendaraan yang lewat tol harus membayar sejumlah uang. Sebagian pengendara kendaraan tidak membawa uang. Kesimpulan yang tepat adalah ?', NULL, 'Beberapa kendaraan melewati tol tidak membayar', NULL, NULL, 'Beberapa kendaraan tidak membawa uang melewati tol.', NULL, NULL, 'Beberapa kendaraan yang melewati tol membayar sejumlah uang', NULL, NULL, 'Beberapa kendaraan tidak melewati tol.', NULL, NULL, 'Semua kendaraan tidak melewati tol karena tidak perlu membayar.', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(233, '403', '<span style="font-family: Calibri, sans-serif;">Bacalah pernyataan-pernyataan yang diberikan dengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan pernyataan berikut</span><br>Tidak ada seorangpun peserta ujian di dalam ruang tes diperbolehkan membawa alat komunikasi. Sebagian mahasiswa masuk ke dalam ruangan tes.', NULL, 'Sebagian mahasiswa di dalam ruang tes tidak membawa alat komunikasi.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes diperbolehkan membawa alat komunikasi.', NULL, NULL, 'Semua mahasiswa dalam ruangan tes tidak diperbolehkan membawa alat komunikasi.', NULL, NULL, 'Hanya mahasiswa dalam ruang tes yang dibolehkan membawa alat komunikasi.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes bukan peserta ujian diperbolehkan membawa alat komunikasi.', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(234, '403', '<span style="font-family: Calibri, sans-serif;">Bacalah pernyataan-pernyataan yang diberikan dengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan pernyataan berikut</span><br>Jika Koko tidak menghentikan kebiasaan merokok, maka penyakit jantungnya akan bertambah parah. Jika sakit jantungnya bertambah parah, maka Koko tidak bisa ikut bertanding membela keseblasa kebanggaaan kota A. Koko bertanding membela keseblasan kota A. Kesimpulan yang benar adalah?', NULL, 'Sakit jantung Koko tidak parah', NULL, NULL, 'Koko sudah kebal terhadap nikotin', NULL, NULL, 'Koko telah mengurangi dosis merokokny.', NULL, NULL, 'Koko tidak merokok lagi', NULL, NULL, 'Koko dipaksa bermain oleh pelatihnya.', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(235, '403', '<span style="font-family: Calibri, sans-serif;">Bacalah pernyataan-pernyataan yang diberikan dengan cermat. Kemudian tentukan kesimpulan yang tepat berdasarkan pernyataan berikut<br></span>Semua murid SMP Jago wajib menggunakan topi pada hari Senin. Lusa adalah hari Jumat. Roni adalah salah satu murid kelas 8 di SMP Jago. Kesimpulannya adalah ?.', NULL, 'Kemarin Roni pasti memakai topi', NULL, NULL, 'Roni tidak wajib memakai topi hari ini', NULL, NULL, 'Empat hari yang akan datang, Roni wajib memakai topi', NULL, NULL, 'Hari ini Roni wajib memakai topi', NULL, NULL, 'Roni tidak pernah memakai topi', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(236, '403', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Inayah selesai mengerjakan soal lebih\r\ncepat dibandingkan Ririn. Ali selesai tidak lebih cepat dari Tarmizi. Fitrah\r\nselesai lebih lambat dibanding Ririn.<br><br><o:p></o:p></span></p>Jika Inayah lebih cepat dibandingkan Ali, maka yang paling lambat adalah', '40356.png', 'Inayah', NULL, NULL, 'Ririn', NULL, NULL, 'Tarmizi', NULL, NULL, 'Ali', NULL, NULL, 'Fitrah', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(237, '403', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Inayah selesai mengerjakan soal lebih\r\ncepat dibandingkan Ririn. Ali selesai tidak lebih cepat dari Tarmizi. Fitrah\r\nselesai lebih lambat dibanding Ririn.<br><br><o:p></o:p></span></p>Jika Tarmizi selesai lebih lambat dari Ririn dan Fitrah tidak lebih cepat dari Ali, maka yang selesai pada urutan keempat adalah', '40357.png', 'Inayah', NULL, NULL, 'Ririn', NULL, NULL, 'Tarmizi', NULL, NULL, 'Ali', NULL, NULL, 'Fitrah', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(238, '403', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Enam orang harus berdiri dalam satu\r\nbaris. Tini tidak mau bersebelahan dengan Salim dan Tia. Nila ingin dekat\r\ndengan Tia. Tini ingin dekat dengan Jukri. Dan Jukri ingin dekat dengan Nila.\r\nSalim tidak ingin didahului Harto, dan Harto ingin bersebelahan dengan Tini.\r\nAkhirnya Tia ingin berada pada urutan terakhir.<o:p></o:p></span></p>Susunan yang terjadi dari urutan terakhir hingga urutan pertama adalah?', '40358.png', 'Tia ? Nila ? Jukri ? Tini ? Harto ? Salim', NULL, NULL, 'Salim ? Harto ? Tini ? Jukri ? Nila ? Tia', NULL, NULL, 'Harto ? Tini ? Jukri ? Nila ? Tia ? Salim', NULL, NULL, 'Salim ? Tini ? Jukri ? Nila ? Tia', NULL, NULL, 'Tia ? Jukri ? Tini ? Salim ? Nila', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
	(239, '403', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Enam orang harus berdiri dalam satu\r\nbaris. Tini tidak mau bersebelahan dengan Salim dan Tia. Nila ingin dekat\r\ndengan Tia. Tini ingin dekat dengan Jukri. Dan Jukri ingin dekat dengan Nila.\r\nSalim tidak ingin didahului Harto, dan Harto ingin bersebelahan dengan Tini.\r\nAkhirnya Tia ingin berada pada urutan terakhir.<br><br><o:p></o:p></span></p>Yang mengapit Nila adalah ?', '40359.png', 'Harto dan Jukri', NULL, NULL, 'Tini dan Salim', NULL, NULL, 'Jukri dan Tia', NULL, NULL, 'Tia dan Tini', NULL, NULL, 'Tini dan Harto', NULL, NULL, 'O', '2024-07-21 06:31:30', '2024-07-21 06:31:30'),
