	(291, '503', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Jika Farah tidak kuliah maka ia membantu Ibu berjualan di pasar.', NULL, 'Farah saat ini kuliah dan ia pasti akan membantu Ibu berjualan di pasar.', NULL, NULL, 'Farah sekarang ada di pasar berjualan, karena tidak kuliah.', NULL, NULL, 'Sekarang Farah tidak kuliah, jadi ia tak perlu ke pasar untuk membantu Ibunya berjualan.', NULL, NULL, 'Farah tidak membantu Ibunya berjualan di pasar karena ia tidak kuliah.', NULL, NULL, 'Sebagai mahasiswa yang baik, meskipun punya kuliah, Fara tetap akan membantu Ibunya berjualan di pasar.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(292, '503', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Semua peserta ujian wajib membawa kartu ujian. Sebagian peserta ujian bersepatu.', NULL, 'Semua peserta ujian membawa kartu ujian dan mengenakan sepatu.', NULL, NULL, 'Semua peserta ujian yang membawa kartu ujian pasti bersepatu', NULL, NULL, 'Semua peserta ujian yang bersepatu membawa kartu ujian.', NULL, NULL, 'Sebagian peserta ujian yang bersepatu, tidak membawa kartu ujian.', NULL, NULL, 'Semua peserta ujian yang bersepatu, tidak membawa kartu ujian.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(293, '503', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Tidak ada seorangpun peserta ujian di diperbolehkan menyontek.\r\nSebagian mahasiswa masuk ke dalam ruangan tes.', NULL, 'Semua mahasiswa dalam ruangan tes tidak diperbolehkan menyontek.', NULL, NULL, 'Sebagian mahasiswa di dalam ruang tes tidak menyontek.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes diperbolehkan menyontek.', NULL, NULL, 'Hanya mahasiswa dalam ruang tes yang dibolehkan menyontek.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes bukan peserta ujian diperbolehkan menyontek.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
