	(295, '503', '<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan yang tepat,&nbsp;</span>Semua peserta Ujian Mandiri gemar belajar. Peserta yang gemar belajar senang menulis. Peserta yang gemar menulis tidak pandai bermain pencak silat.', NULL, 'Peserta yang tidak pandai pencak silat, gemar belajar.', NULL, NULL, 'Peserta yang tidak pandai pencak silat, tidak gemar belajar.', NULL, NULL, 'Peserta yang tidak pandai pencak silat, gemar menulis dan tidak gemar belajar.', NULL, NULL, 'Peserta yang tidak pandai pencak silat, gemar belajar dan tidak gemar menulis.', NULL, NULL, 'Peserta yang tidak pandai pencak silat, tidak gemar membaca dan tidak gemar menulis.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(296, '503', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="SV" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri;mso-ansi-language:SV">Julio, Tika, dan\r\nDodi berusia sama. Ayah mereka mulai bekerja pada usia 25 tahun di perusahaan\r\nyang sama. </span><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri">Perusahaan\r\ntersebut mengharuskan pegawai yang usianya 60 tahun untuk pensiun.<o:p></o:p></span></p>\r\n\r\n<p class="MsoListParagraphCxSpFirst" style="margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-align:justify;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:21.3pt;\r\nmso-layout-grid-align:none;text-autospace:none"><!--[if !supportLists]--><span lang="SV" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri;mso-ansi-language:\r\nSV">(a)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="SV" style="font-size:12.0pt;\r\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri;mso-ansi-language:SV">Tahun ini, usia ayah Julio tiga kali usia Tika.<o:p></o:p></span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-align:justify;\r\ntext-indent:-18.0pt;line-height:n