	(298, '503', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Dalam pertandingan catur, Anto selalu\r\nkalah melawan Badu. Namun, dalam cabang olah raga yang lainnya, Anto selalu\r\nmenang melawan Endri. </span><span lang="SV" style="font-size:12.0pt;mso-ascii-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri;mso-ansi-language:\r\nSV">Cendri selalu menang dalam pertandingan badminton melawan Anto. Akan tetapi\r\ndalam catur, Cendri akan kalah bila melawan Anto. Endri adalah pemain takraw\r\nterbaik, tetapi dalam olahraga badminton dia tidak sebaik Badu. Dalam cabang\r\nbadminton, Deni lebih baik daripada Anto, sedangkan dalam catur ia menempati\r\nurutan di bawah Endri.<o:p></o:p></span></p>Untuk olah raga badminton, ranking pemain terbaik berturut-turut adalah?', '50358.png', 'Deni-Cendri-Anto-Badu-Endri', NULL, NULL, 'Badu-Anto-Cendri-Endri-Deni', NULL, NULL, 'Anto-Badu-Cendri-Deni-Endri', NULL, NULL, 'Endri-Deni-Cendri-Badu-Anto', NULL, NULL, 'Deni-Endri-Cendri-Badu-Anto', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
