	(340, '602', 'Seorang buruh pabrik diupah Rp. 6.000 per jam, dengan waktu kerja 8 jam dari pukul 08.00 sampai 16.00. Jika ia bekerja lembur, ia mendapatkan tambahan 25% dari upahnya per jam. Jika pada hari tersebut ia mendapat upah Rp. 63.000,  pukul berapakah ia meninggalkan pabrik?', NULL, '17.00', NULL, NULL, '17.30', NULL, NULL, '18.00', NULL, NULL, ' 19.00', NULL, NULL, '19.30', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
