	(351, '603', '<span lang="SV" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:SV;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulannya ,</span>Semua mahasiswa wajib mengenakan sepatu. Sebagian mahasiswa menyukai baju kaos hitam.', NULL, 'Semua mahasiswa mengenakan sepatu dan menyukai kaos hitam.', NULL, NULL, 'Semua mahasiswa yang mengenakan sepatu pasti menyukai kaos hitam', NULL, NULL, 'Sebagian mahasiswa yang menyukai kaos hitam, tidak mengenakan sepatu.', NULL, NULL, 'Semua mahasiswa yang menyukai kaos hitam, bersepatu.', NULL, NULL, 'Semua mahasiswa yang menyukai kaos hitam, tidak mengenakan sepatu.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(352, '603', '<span lang="SV" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:SV;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulannya,&nbsp;</span>Semua siswa memiliki Nomor Induk siswa. Anto seorang siswa. Jadi,..', NULL, 'Anto mungkin memiliki nomor induk siswa.', NULL, NULL, 'Belum tentu Anto memiliki nomor induk siswa.', NULL, NULL, 'Anto memiliki nomor induk siswa.', NULL, NULL, 'Anto tidak memiliki nomor induk siswa.', NULL, NULL, 'Tidak dapat ditarik kesimpulan.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(353, '603', '<span lang="SV" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:SV;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulannya,&nbsp;</span>Tidak ada seorangpun peserta ujian di dalam ruang tes diperbolehkan membawa alat komunikasi. Sebagian mahasiswa masuk ke dalam ruangan tes.', NULL, 'Sebagian mahasiswa di dalam ruang tes tidak membawa alat komunikasi.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes diperbolehkan membawa alat komunikasi.', NULL, NULL, 'Semua mahasiswa dalam ruangan tes tidak diperbolehkan membawa alat komunikasi.', NULL, NULL, 'Hanya mahasiswa dalam ruang tes yang dibolehkan membawa alat komunikasi.', NULL, NULL, 'Sebagian mahasiswa dalam ruang tes bukan peserta ujian diperbolehkan membawa alat komunikasi.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(354, '603', '<span lang="SV" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:SV;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulan,&nbsp;</span>Semua mahasiswa gemar bermain futsal. Siswa yang gemar bermain futsal senang berenang. Siswa yang gemar berenang tidak pandai bermain anggar.', NULL, 'Siswa yang tidak pandai bermain anggar, tidak pandai bermain futsal.', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, gemar berenang dan tidak pandai bermain futsal.', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, pandai bermain futsal dan tidak gemar berenang', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, tidak pandai bermain futsal dan tidak gemar berenang', NULL, NULL, 'Siswa yang tidak pandai bermain anggar, pandai bermain futsal.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(355, '603', '<span lang="SV" style="font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:SV;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Bacalah pernyataan-pernyataan yang diberikan\r\ndengan cermat. Kemudian tentukan kesimpulannya,&nbsp;</span>Jika saya tidak punya tugas kuliah maka saya belajar di perpustakaan.', NULL, 'Saya saat ini memiliki tugas kuliah dan pasti akan belajar di perpustakaan.', NULL, NULL, 'Saya sekarang ada di perpustakaan belajar, karena tidak punya tugas kuliah.', NULL, NULL, 'Sekarang saya tidak punya tugas kuliah, jadi saya tak perlu ke perpustakaan untuk belajar.', NULL, NULL, 'Saya tidak belajar di perpustakaan karena saya tidak punya tugas kuliah.', NULL, NULL, 'Sebagai mahasiswa yang baik, meskipun punya tugas kuliah, saya tetap akan belajar di perpustakaan.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(356, '603', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Di suatu hari, seorang psikolog mempunyai\r\njadwal konsultasi dengan 7 orang kliennya, yakni Angga, Bila, Citra, Deva,\r\nEdgar, Fitrah, dan Gilang. Semua pasien memiliki jadwal konsultasi\r\nmasing-masing. Jadwal konsultasi 1 sampai 7 harus memenuhi konisi berikut:</span></p><p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none">-<span style="white-space:pre">	</span>Bila mempunyai jadwal konsultasi sebelum Gilang.</p><p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none">-<span style="white-space:pre">	</span>Fitrah mempunyai jawal konsultasi sebelum Angga.</p><p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none">-<span style="white-space:pre">	</span>Salah satu Citra atau Edgar memiliki jadwal konsultasi di urutan ketiga.</p><p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style=""></span></p><p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none">-<span style="white-space:pre">	</span>Deva mempunyai jadwal konsultasi tepat setelah Citra atau tepat sebelum Citra.</p><div style="text-align: justify;"><br></div><ul><li style="margin-bottom: 0cm; text-align: justify; text-indent: -18pt; line-height: normal;"><span style="font-size: 1rem; text-align: left;">Siapakah klien yang mempunyai jawal konsultasi kedua ?</span><br></li></ul>', '60356.png', 'Angga', NULL, NULL, 'Bila', NULL, NULL, 'Edgar', NULL, NULL, 'Fitrah', NULL, NULL, 'Gilang', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(357, '603', '<p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;"><span lang="EN-US" style="font-size: 12pt;">Di suatu hari, seorang psikolog mempunyai jadwal konsultasi dengan 7 orang kliennya, yakni Angga, Bila, Citra, Deva, Edgar, Fitrah, dan Gilang. Semua pasien memiliki jadwal konsultasi masing-masing. Jadwal konsultasi 1 sampai 7 harus memenuhi konisi berikut:</span></p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Bila mempunyai jadwal konsultasi sebelum Gilang.</p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Fitrah mempunyai jawal konsultasi sebelum Angga.</p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Salah satu Citra atau Edgar memiliki jadwal konsultasi di urutan ketiga.</p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;"><span lang="EN-US"></span></p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Deva mempunyai jadwal konsultasi tepat setelah Citra atau tepat sebelum Citra.</p>Jika Gilang mempunyai jawal konsultasi urutan kedua dan Angga urutan kelima, maka pernyataan berikut yang benar adalah ?', '60357.png', 'Citra mempunyai jadwal konsultasi ketiga', NULL, NULL, 'Deva mempunyai jawal konsultasi urutan keempat', NULL, NULL, 'Deva mempunyai jadwal konsultasi ketujuh', NULL, NULL, 'Fitrah mempunyai jawal konsultasu urutan kesatu', NULL, NULL, 'Fitrah mempunyai jadwal konsultasi ketujuh.', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(358, '603', '<p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;"><span lang="EN-US" style="font-size: 12pt;">Di suatu hari, seorang psikolog mempunyai jadwal konsultasi dengan 7 orang kliennya, yakni Angga, Bila, Citra, Deva, Edgar, Fitrah, dan Gilang. Semua pasien memiliki jadwal konsultasi masing-masing. Jadwal konsultasi 1 sampai 7 harus memenuhi konisi berikut:</span></p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Bila mempunyai jadwal konsultasi sebelum Gilang.</p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Fitrah mempunyai jawal konsultasi sebelum Angga.</p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Salah satu Citra atau Edgar memiliki jadwal konsultasi di urutan ketiga.</p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;"><span lang="EN-US"></span></p><p class="MsoNormal" style="margin-bottom: 0cm; text-align: justify; line-height: normal;">-<span style="white-space: pre;">	</span>Deva mempunyai jadwal konsultasi tepat setelah Citra atau tepat sebelum Citra.</p>Urutan yang sesuai dengan jadwal konsultasi adalah ?', '60358.png', 'Bila, Edgar, Gilang, Fitrah, Angga, Deva, Citra', NULL, NULL, 'Bila, Gilang, Edgar, Fitrah, Angga, Citra, Deva', NULL, NULL, 'Gilang, Bila, Edgar, Fitrah, Angga, Citra, Deva', NULL, NULL, 'Gilang, Fitrah, Bila, Edgar, Angga, Deva, Citra', NULL, NULL, 'Fitrah, Angga, Gilang, Bila, Edgar, Deva, Citra', NULL, NULL, 'O', '2024-07-21 06:31:31', '2024-07-21 06:31:31'),
	(359, '603', '<p class="MsoNormal" style="margin-bottom:0cm;text-align:justify;line-height:\r\nnormal;tab-stops:21.3pt;mso-layout-grid-align:none;text-autospace:none"><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-hansi-font-family:\r\nCalibri;mso-bidi-font-family:Calibri">Inayah, Andi, dan Dodi berusia sama. Ayah\r\nmereka mulai bekerja pada usia 25 tahun di perusahaan yang sama. Perusahaan\r\ntersebut mengharuskan pegawai yang usianya 60 tahun untuk pensiun.<o:p></o:p></span></p>\r\n\r\n<p class="MsoListParagraphCxSpFirst" style="margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:35.45pt;mso-add-space:auto;text-align:justify;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:21.3pt;\r\nmso-layout-grid-align:none;text-autospace:none"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri">(a)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">Tahun ini, usia ayah Inayah tiga kali usia Inayah.<o:p></o:p></span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:35.45pt;mso-add-space:auto;text-align:justify;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:21.3pt;\r\nmso-layout-grid-align:none;text-autospace:none"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri">(b)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">Tahun ini, usia ibu Andi tiga kali usia Andi, dan ibunya tiga tahun\r\nlebih muda dari ayahnya.<o:p></o:p></span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:35.45pt;mso-add-space:auto;text-align:justify;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:21.3pt;\r\nmso-layout-grid-align:none;text-autospace:none"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri">(c)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nmso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">Tiga tahun yang lalu, perbandingan usia Dodi dan usia ayahnya sama\r\ndengan perbandingan antara usia Inayah dan ayahnya tahun ini.<o:p></o:p></span></p>\r\n\r\n<p class="MsoListParagraphCxSpLast" style="margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-lef